                fullDescription:
                    'Электрическая зубная щётка Oral-B 4000 Smart Series с Bluetooth удаляет до 2 раз больше зубного налёта, чем мануальная зубная щётка. 3D-технология чистки (сочетание возвратно-вращательных и пульсирующих движений) обеспечивает удаление до 100% больше зубного налёта по сравнению с обычными щётками. Через Bluetooth щётка подключается к смартфону, синхронизируясь с приложением Oral-B App (оно бесплатно и доступно для iOS и Android). С помощью этого приложения можно проверить свои навыки чистки, научиться правильной технике, следить за своим прогрессом и изменением привычек. Приложение поможет выбрать нужный режим чистки в соответствии с вашими индивидуальными предпочтениями и потребностями. Благодаря двухминутному таймеру легко контролировать длительность чистки, соблюдая рекомендуемое стоматологами время. Для бережного очищения предусмотрен датчик давления: если во время чистки вы сильно надавливаете щёткой на зубы, на задней стороне щётки загорается световой индикатор. Щетинки двух насадок Cross Action, входящих в комплект, наклонены под нужным углом для эффективной чистки межзубных промежутков.<p>Имеется 3 режима чистки:</p><p>- Daily Clean (ежедневная чистка) — стандартная чистка полости рта;<br />- Whitening (отбеливание) — интенсивное осветление эмали;<br />- Sensitive (чувствительный) — особенно мягкая чистка для чувствительных зон полости рта или в период после лечения.</p>',
