                slug: 'elektricheskaia-zubnaia-shchetka-oral-b-smart-6-6000n',
                description: ', питание от аккумулятора, с 2 насадками в комплекте, 5 режимов работы, датчик нажима',
                fullDescription:
                    'Электрическая зубная щетка Oral-B Smart 6 с Bluetooth удаляет до 100% больше зубного налёта, чем мануальные зубные щётки, и улучшает здоровье дёсен.<p>Через Bluetooth щётка синхронизируется с бесплатным приложением Oral-B App для iOS и Android, контролируя в режиме реального времени процесс чистки зубов, что позволяет улучшить его качество. Электрическая зубная щётка Oral-B Smart 6 чистит зубы именно так, как рекомендуют стоматологи.</p><p>В комплект входят аккумуляторная электрическая зубная щётка (1 шт.), зарядное устройство (1 шт.), премиальный дорожный футляр (1 шт.), держатель для смартфона (1 шт.) и 2 насадки:</p><p>- насадка Cross Action: щетинки, расположенные под углом 16°, окружают каждый зуб, бережно удаляя до 100% больше налёта даже из труднодоступных мест;<br />- насадка Sensitive с более мягкими щетинками для бережной чистки чувствительных участков полости рта;</p><p>Имеются 5 режимов чистки: «Ежедневная чистка», «Уход за дёснами», «Для чувствительных зубов», «Отбеливание», «Интенсивная чистка».</p><p>Подходит для детей с 3-х лет.</p><p>10500 возвратно-вращательных движений &#43; 48000 пульсирующих движений.</p><p>Перейдите на новый уровень чистки за 2 минуты!</p><p>- круглая форма насадки: очищает каждый зуб со всех сторон;<br />- встроенный таймер, который помогает чистить зубы рекомендуемые стоматологом 2 минуты;<br />- датчик давления, который предупреждает звуковым сигналом при чрезмерном надавливании на щётку, автоматически отключает пульсацию и снижает скорость вращения насадки, защищая дёсны;<br />- новый Li-Ion аккумулятор для более длительной работы и быстрой зарядки;<br />- технология 360° SmartRing со светодиодами позволит вам персонализировать чистку зубов, выбирая один из 12 цветов подсветки;<br />- голубые щетинки Indicator обесцвечиваются наполовину, сигнализируя о необходимости замены насадки. Регулярно меняйте насадку, чтобы постоянно получать превосходный результат (менять насадку рекомендуется в среднем раз в 3 месяца);<br />- Oral-B — используется большинством стоматологов мира (на основании международных опросов P&amp;G среди репрезентативной выборки стоматологов, проводимой регулярно, в т.ч. 2013-2015 гг.);<br />- гарантия результата или возврат денег. Испытайте в действии зубную щетку Oral-B в течение 30 дней. Если вы не будете на 100% удовлетворены результатом, Oral-B вернёт деньги. Подробная информация: vk.com/insmiles и everydayme.ru/teg/oral-b;<br />- 3D-технология чистки совмещает возвратно-вращательные движения с пульсацией: пульсирующие движения бережно разрыхляют зубной налёт, а возвратно-вращательные движения выметают его и массируют десны;<br />- производится в Германии;<br />- разработана со стоматологами. Закруглённые кончики щетинок и встроенный датчик давления (автоматически отключающий пульсацию при чрезмерном давлении на щетку) гарантируют безопасность применения.</p>',
